import React from "react";
import {Link} from 'react-router-dom'

function Register (props) {

  return (
    <div className="container">
      <h2 className="container__header">
        Регистрация
      </h2>
      <form className="form">
        <input className="form__input" name="email" type="email" placeholder="Email" required />
        <input className="form__input" name="password" type="password" placeholder="Пароль" required />
        <button className="form__submit-button" type="submit">
          Зарегистрироваться
        </button>
      </form>
      <p className="container__title">Уже зарегистрированы?
        <Link to="sign-in" className="container__login-link"> Войти</Link>
      </p>
    </div>
  );
};
export default Register;
